"use strict";(self.webpackChunknick_blog=self.webpackChunknick_blog||[]).push([[9450],{6029:function(t){t.exports=JSON.parse('{"blogPosts":[{"id":"First Commit","metadata":{"permalink":"/First Commit","editUrl":"https://github.com/facebook/docusaurus/edit/main/website/blog/blog/2022-04-04-First Commit/index.md","source":"@site/blog/2022-04-04-First Commit/index.md","title":"First Commit","description":"\u5beb\u4efb\u4f55\u7684\u5c08\u6848\uff0c \u901a\u5e38\u7b2c\u4e00\u500bcommit\u90fd\u6703\u4f86\u6253 \\"first commit\\"\uff0c \u6b64\u7bc7\u70ba\u6211\u7684\u90e8\u843d\u683c\u7684\u7b2c\u4e00\u500b first commit","date":"2022-04-04T00:00:00.000Z","formattedDate":"April 4, 2022","tags":[{"label":"first","permalink":"/tags/first"}],"readingTime":2.605,"truncated":false,"authors":[{"name":"kiwee","title":"Backend Developer","url":"https://github.com/nick0916","imageURL":"https://github.com/nick0916.png","key":"kiwee"}],"frontMatter":{"slug":"First Commit","title":"First Commit","authors":["kiwee"],"tags":["first"]}},"content":"> \u5beb\u4efb\u4f55\u7684\u5c08\u6848\uff0c \u901a\u5e38\u7b2c\u4e00\u500bcommit\u90fd\u6703\u4f86\u6253 \\"first commit\\"\uff0c \u6b64\u7bc7\u70ba\u6211\u7684\u90e8\u843d\u683c\u7684\u7b2c\u4e00\u500b first commit\\n```shell\\ngit commit -m \\"first commit\\"\\n```\\n\\n## \u5de5\u4f5c\u5169\u5e74\u5f8c..\u60f3\u4f86\u8a18\u9304\u4e0b\u4ec0\u9ebc\\n\u6b64\u6642\u6b64\u523b\uff0c\u6211\u5df2\u5728\u793e\u6703\u4e0a\u6253\u6efe\u4e86\u5169\u5e74\uff0c\u7e3d\u89ba\u5f97\u5f88\u591a\u6771\u897f\uff0c\u90fd\u8a72\u597d\u597d\u7684\u8a18\u9304\u4e0b\u4f86\uff0c\u4e26\u4e14\u7cfb\u7d71\u5316\u81ea\u5df1\u7684\u77e5\u8b58\u5eab\\n\\n\u6240\u4ee5\u9019\u500b\u90e8\u843d\u683c\u5c31\u9019\u6a23\u8a95\u751f...\\n\\n\u73fe\u5728\u4e0d\u8ad6\u662f\u5de5\u4f5c\u6216\u662f\u4e0b\u73ed, \u6642\u5e38\u5438\u6536\u5230\u7684\u77e5\u8b58, \u90fd\u662f\u96f6\u788e\u5316\u7684, \u9019\u8b93\u6211\u5011\u6bcf\u6b21\u5728\u6478\u65b0\u6280\u8853, \u90fd\u6703\u5f88\u50cf\u778e\u5b50\u6478\u8c61, \u6bcf\u6b21\u53ea\u6478\u7684\u5176\u4e2d\u4e00\u500b\u90e8\u5206\\n\\n\u751a\u81f3\u56e0\u70ba\u5de5\u4f5c\u7684\u7dca\u8feb\u6027, \u6703\u990a\u6210\u4e0d\u597d\u7684\u7fd2\u6163, \u770b\u5230\u89e3\u6cd5\u5c31\u76f4\u63a5\u7528, \u800c\u4e0d\u6703\u5728\u8ffd\u7a76\u5176\u80cc\u5f8c\u7d30\u7bc0\u539f\u7406...\\n\\n\u56e0\u6b64, \u6211\u89ba\u5f97\u6703\u9700\u8981\u990a\u6210\u7fd2\u6163, \u5b9a\u6642\u5730\u628a\u9019\u4e9b\u788e\u7247\u7d66\u7d44\u88dd\u8d77\u4f86, \u5b8c\u5584\u597d\u81ea\u5df1\u7684\u77e5\u8b58\u5eab, \u751a\u81f3\u53ef\u4ee5\u7d66\u672a\u4f86\u7684\u81ea\u5df1, \u5feb\u901f\u56de\u60f3\u8d77\u904e\u53bb\u6240\u7528\u5230\u7684\u6280\u8853\\n\\n\u751a\u81f3\u4e5f\u53ef\u4ee5\u597d\u597d\u770b\u4e00\u4e0b, \u5de5\u4f5c\u5230\u73fe\u5728, \u81ea\u5df1\u5230\u5e95\u9032\u6b65\u4e86\u591a\u5c11? \\n\\n\u9084\u662f\u5176\u5be6\u81ea\u5df1\u5728\u4e0d\u77e5\u9053\u7684\u60c5\u6cc1\u4e0b\u4e00\u76f4\u539f\u5730\u6253\u8f49\uff1f\\n\\n## \u9664\u4e86\u6280\u8853\u7684\u7d00\u9304\u4e4b\u5916, \u6211\u9084\u60f3\u8981...\\n\\n\u7136\u800c\uff0c\u9019\u908a\u5e0c\u671b\u4e0d\u53ea\u662f\u55ae\u5f9e\u7684\u6280\u8853\u7d00\u9304\uff0c\u6211\u5e0c\u671b\u4e5f\u53ef\u4ee5\u5c07\u6211\u5de5\u4f5c\u9ad4\u6703\u5230\u7684\u5fc3\u8def\u6b77\u7a0b\uff0c\u597d\u597d\u5beb\u4e0b\\n\\n\u66f4\u91cd\u8981\u7684\u662f\uff0c\u4e5f\u53ef\u4ee5\u8a18\u9304\u8d77\uff0c\u6211\u81ea\u5df1\u7684\u751f\u6d3b\uff0c\u597d\u597d\u6aa2\u8a0e\u81ea\u5df1\u7684\u751f\u6d3b\u904e\u5f97\u5be6\u5728\u592a\u7121\u8da3\uff08\uff1f\\n\\n> Work Hard, Play Hard\\n\\n\u7576\u6211\u5e38\u5e38\u6ed1IG\uff0c\u770b\u5230\u4e00\u4e9b\u53b2\u5bb3\u7684\u670b\u53cb\u5011\uff0c\u5404\u5f0f\u5404\u6a23\u5145\u5be6\u7684\u751f\u6d3b\uff0c\u90fd\u6703\u8b93\u6211\u60f3\u8d77\u9019\u53e5\u8a71\\n\\n\u6240\u4ee5\u9019\u500b\u90e8\u843d\u683c\uff0c\u6211\u4e5f\u8981\u4f86\u900f\u904e\u9019\u500b\uff0c\u597d\u597d\u8a18\u9304\u8d77\uff0c\u6211\u5c0d\u751f\u6d3b\u4e0a\uff0c\u5927\u5927\u5c0f\u5c0f\u4e8b\u60c5\\n\\n\u7576\u7136\uff0c\u76ee\u524d\u81ea\u5df1\u5be6\u5728\u662f\u6bc5\u529b\u6709\u9650\uff0c\u6240\u4ee5\u9084\u662f\u5f97\u8981\u5e38\u5e38\u903c\u81ea\u5df1\u4f86\u597d\u597d\u7d93\u71df\u624d\u884c\uff38\uff24\\n\\n\u5e0c\u671b\u4e4b\u5f8c\u53ef\u4ee5\u6709\u4e0d\u5c11\u597d\u6587\u7ae0, \u7d66\u81ea\u5df1\u7d00\u9304\u4e4b\u865e, \u4e5f\u53ef\u4ee5\u8b93\u5927\u5bb6\u90fd\u53ef\u4ee5\u6709\u9ede\u6536\u7372\uff5e\uff5e\\n\\n\u5171\u52c9\u4e4b\uff5e"}]}')}}]);